import React from "react";
import { Carousel } from "react-responsive-carousel";
import img1 from "../assets/3.jpg";
import img2 from "../assets/4.jpg";
function Services() {
  return (
    <div className="services">
      <Carousel>
        <div>
          <img src={img1} alt="Item1" />
          <p>Full Stack</p>
        </div>
        <div>
          <img src={img1} alt="Item1" />
          <p>Full Stack</p>
        </div>
      </Carousel>
    </div>
  );
}

export default Services;
